@EU_Commission The Commission's duplicity is astounding.
First you fk up their lives and now you want to help them? How? By making sure they get their shot &amp; digital id, or no education, no job, no travel. Is that the future you're offering? Is THAT a future?
I'd like some answers.

@EU_Commission As the #EU have gained more power, the rate of manufacturing production has steadily declined and the pace of consumer product importing has increased.
The #EU now imports each year a record $219 USD Billions facilitating #Europeans to import their own unemployment.
#EUexit now!

@EU_Commission @EurobarometerEU A currency is not the problem, even if prices doubled the very next day my country started using it.
The EU ITSELF is the problem.
Btw, my € has massively different value than say Germany's or Finland's - so, whose € does your little poll refers to?

@EU_Commission @EurobarometerEU It's all about how you ask this question.
The currency in itself isn't bad as long as you aren't stuck in a monetary union with so many shithole countries that cannot hold up their own pants.
In their eagerness to expand, the EU set the bar way too low.
